import React from 'react';
import {
  View,
  Text
} from 'react-native';
import styled from 'styled-components/native';


export default function PageContainer(props) {
  return (
    <Container>
      {props.children}
      <Text>This is deneme</Text>
    </Container>
  );
}

const Container = styled.View`
  width: 390px;
  height: 530px;
  padding: 35px 30px 63px;
  border-radius: 8px;
  background-color: white;

  shadow-color: #000;
  shadow-offset: { width: 10, height: 16};
  shadow-opacity: 0.1;
  shadow-radius: 2;
  elevation: 1;
`;
